import React from 'react';
import axios from 'axios';

class Bins extends React.Component {

  state = {
    BinID: '',
    BinName: ''
  };

  render() {

    return(
      <div>
        <h2>Welcome to Bins</h2>
        <h4>Add a bin</h4>
        <form>
          <div className="form-input">
            <input
              type="text"
              name="BinID"
              value={this.state.BinID}
              placeholder="Bin ID"
              onChange={2}
            /> 
          </div>
          <div className="form-input">
            <input
              type="text"
              name="BinName"
              value={this.state.BinName}
              placeholder="Bin Name"
              onChange={2}
            /> 
          </div>
          <button>Submit</button>
        </form>

      </div>
    );
  }
}

export default Bins;
